DELIMITER $$
CREATE TRIGGER `insert_admin_after_employee_insert` AFTER INSERT ON `election_commission_employees` FOR EACH ROW BEGIN
    IF NEW.Is_admin = 'Yes' THEN
        INSERT INTO admin (admin_name, username, password, email_id, aadhar_card_number,Employee_ID)
        VALUES (NEW.employee_name, NEW.username, NEW.password, NEW.email_id, NEW.aadhar_card_number,NEW.employee_ID); 
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_admin_password` AFTER UPDATE ON `election_commission_employees` FOR EACH ROW BEGIN
    IF NEW.Is_admin = 'Yes' THEN
        UPDATE admin
        SET password = NEW.password
        WHERE Employee_ID = NEW.employee_ID;
    END IF;
END
$$
DELIMITER ;

